import React from "react";
import Card from "../Card";
import "./style.css";

function CardContainer(props) {
  return (
    <div className="jumbotron card-container">
      {/* Pass props to Card */}
      <Card 
          handleclick={props.handleclick}
          title={props.title}
          image={props.image}
          profileUrl={props.profileUrl}
      />
    </div>
  );
}

export default CardContainer;
